description:
Endless Bummer,directed by Sam Pillsbury. This time Sam Pillsbury came with great cast of teen actors that is Khan Chittende and Colton James, the best comedians for the youngsters.

Plot: A group of teens and a veteran surfer take a road trip from Ventura, CA to the San Fernando Valley in order to track down a prized stolen surfboard..

